219": ["Ерунда, не стоит своих денег , не подходят, не растягиваются ", "2020-12-10T08:59:47Z", "прозрачный", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "220": ["Отлично  мне понравились", "2020-12-05T07:06:07Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "222": ["Хорошие крышки\n", "2020-12-09T13:20:39Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "223": ["Не понравились .", "2020-12-09T06:50:57Z", "светло-зеленый", "0", 0, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "224": ["Хорошие крышки, давно искала, без запаха, удобны в использовании, рекомендую.", "2020-12-09T05:49:28Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "232": ["Фигня полная, ничего не держит, прилегают к посуде, а после нескольких минут слетают, деньга на ветер! НЕ РЕКОМЕНДУЮ!!!", "2020-12-07T17:40:32Z", "светло-зеленый", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "234": ["Практично. Удобно. Главное - мокрыми не натягивать.", "2020-12-07T14:15:18Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "236": ["Мне не понравились. Не растягиваются . Вылетают . ", "2020-12-07T11:23:26Z", "синий", "0", 1, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "244": ["По описанию на 21 см идет №4. Хрен там!!!!!!!!!!!!!!Еле натянули самую большую. Крышки отстой!!!!!!!!!!!!!!!", "2020-12-01T16:58:32Z", "светло-зеленый", "0", 1, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "247": ["Отличные крышки ! Вот пишут что соскальзывают , нужно одевать на сухую посуду сухую крышку тогда не чего не соскальзывает 👍", "2020-12-03T12:27:44Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "248": ["Товар был упакован хорошо и пришёл в целости и сохранности. Но крышки не понравились: тянутся плохо, с бОльшей части посуды соскальзывают. Жалею, что сделала этот заказ.", "2020-12-02T18:08:29Z", "синий", "0", 1, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "250": ["Ужасные крышки. Соскальзывают с любой формы", "2020-11-30T19:40:09Z", "светло-зеленый", "0", 3, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "251": ["Пришло быстро, но крышка соскальзывает с стеклянной салатницы, наверное зависит от материала тарелки", "2020-11-30T15:24:06Z", "розовый", "0", 2, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "253": ["Что то я не поняла: на один край тянешь, другой слазит. ", "2020-11-29T17:11:34Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "256": ["Заказ получал супруг не проверяя качество. Дома очень были удивлены отправленному товару. Крышки в рваном и помятом пакете. И товар в дырках, словно грызли мышки. Такое первый раз. Не приятно. Просим заменить товар на качественный не снимая процент выкупа.", "2020-11-29T10:06:16Z", "синий", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "258": ["Плотные не как на алиэкспрессе", "2020-10-13T15:07:14Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "261": ["Сегодня забрала крышки и обнаружила что на них дырочки. Буду возвращать.", "2020-11-28T10:49:57Z", "синий", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "262": ["Трудно одеваются, чуть начнёшь и сползает.", "2020-11-28T08:26:42Z", "прозрачный", "0", 1, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "263": ["Они не тянутся так, как заявлено-на круглую посуду. Только под размер.", "2020-11-27T19:41:50Z", "синий", "0", 2, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "270": ["Крышки не оправдали мои ожидания. Одеваются с большим трудом и явно не соответствует заявленному производителем размеру. А так в целом если есть посуда, подходящая по размеру и не требующая большого растяжения, вполне можно пользоваться.", "2020-11-25T14:30:27Z", "светло-зеленый", "0", 2, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "273": ["Крышки ерунда. На миску пыталась одеть, соскальзывает. Звезда за быструю доставку.", "2020-11-24T21:29:14Z", "розовый", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "274": ["Отличнейшие крышки! Мягкие (форму не держат, если нужны твердые крышки, то не подойдет), эластичные, чуть тянутся, не имеют запаха. \r\nУдобная замена пленке. Например, на миску для расстойки теста или быстро накрыть какую-то емкость и убрать в холодильник. По краям перфорация, крышка не сползает. \r\nСпасибо бренду за интересное решение!", "2020-11-24T17:05:37Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "283": ["Крышки хорошие, тянутся хорошо, но использовать нужно только на свой размер, если чуть больше то соскакивают в течение 1 секунды. Самой большой размер 20, но с 22 уже сползает, уже не говоря о 28.", "2020-11-20T08:33:57Z", "синий", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "285": ["Надо натягивать сухие крышки на сухую посуду, тогда не будут соскальзывать", "2020-11-19T17:32:45Z", "светло-зеленый", "0", 5, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "293": ["Мне понравились эти крышки, но надо быть аккуратнее. С длинным маникюром риск порвать. Одну крышечку испортила сразу. Советую.", "2020-11-18T11:17:53Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "294": ["Пока не пробывала в деле, но думаю👍, мягкие, хорошо тянуться", "2020-11-18T07:03:50Z", "светло-зеленый", "0", 0, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "304": ["Крышки очень нравятся. Удобные, чуть растягиваются, подходят под все распространенные размеры посуды.", "2020-11-16T09:25:46Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "305": ["Не на любою ёмкость, на пластмассовые контейнеры не удобно одевать", "2020-11-16T03:53:28Z", "светло-зеленый", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "306": ["Вполне удобные крышки. Но идут каждая на один размер. Не растягиваются.", "2020-11-15T16:21:33Z", "светло-зеленый", "0", 2, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "307": ["Крышки хорошие, силикон не тонкий, плотный, прослужат долго ,но...  эти крышки не тянутся так, как заявлено у производителя и заявленный диаметр производителем отличается на 0,5 см ,самая маленькая крышка-6см(как и заявлено) и тянется до 8 см .Самая большая крышка натягивается на миску диаметром 23 см, не больше.   Ставлю 5 звёзд , потому что мне все и так подошло, мне не надо так растягивать. Спасибо производителю. Для кого не состыковки не критичны , рекомендую. ", "2020-11-15T14:18:45Z", "светло-зеленый", "0", 6, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "308": ["Крышки неплохие, но не соответствуют заявленной таблице растяжения.Силикон растягивается плохо и слезает с посуды.", "2020-11-15T11:59:24Z", "синий", "0", 2, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "310": ["Заказала маме понравилось", "2020-11-14T11:53:32Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "311": ["Супер, все целые. ", "2020-11-14T09:31:09Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "314": ["Совсем не держаться, сползают, пробовала на разных, что кастрюля, что банки.", "2020-11-14T03:31:01Z", "синий", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "318": ["Отличные крышки. Пленка теперь не нужна. Помыла и можно использовать. Полезное изобретение", "2020-11-12T07:07:09Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "320": ["Таакиие классные! Тянутся как чулок. Используем все: от самой маленькой (для стакана со сметаной) до большой (для тазика с салатом и блюда с бутербродами). А уж в подарок любимой близкой подруге к любимому празднику ... дешево и полезно.", "2020-11-10T10:30:17Z", "прозрачный", "0", 4, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "321": ["Крышки из плохого материала, не тянуться как заявлено ! Подошли только на кружку и маленькую тарелку , без натяжения , деньги на ветер - пользуюсь пленкой ", "2020-11-10T08:18:19Z", "розовый", "0", 2, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "322": ["Крышки пришли хорошие", "2020-11-09T12:21:29Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "324": ["Нормально, но в ходу только самая большая, хотелось бы побольше размер.", "2020-11-09T16:42:10Z", "прозрачный", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "330": ["Покупал в подарок. Все довольны. Товар пришёл в полной комплектации.", "2020-11-08T18:12:39Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "335": ["Клёвые крышки, очень удобно)", "2020-11-07T09:48:40Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "336": ["Крышки классные.", "2020-11-07T07:31:05Z", "светло-зеленый", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "337": ["Мне понравилось", "2