0°, запас по температуре до 240° был. Ничего не вылилось. Хорошая альтернатива оборачиванию дна кольца фольгой!", "2020-10-22T14:10:51Z", "прозрачный", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "393": ["Крышки понравились, рекомендую", "2020-10-22T08:39:57Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "395": ["Добрый день. На арбуз 23см не натягивается. Вы пишете 20 на 28. Снимаю 1 звезду", "2020-10-21T14:45:47Z", "розовый", "0", 3, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "397": ["Отличные крышки!\nМеста занимают минимум.\nОчень удобны при использовании,хорошо растягиваются.\nПлотно прилегают к соответствующей размеру,посуде.\nКачественные,без запаха)", "2020-10-21T10:41:16Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "398": ["Крышки очень хорошие , удобны в употреблении ,  для любой тары", "2020-10-21T07:40:56Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "399": ["На стаканы и прочую посуду крышки крепятся нормально, тянутся легко. Но на Арбуз и на дыню натянуть так и не получилось - соскальзывают. Даже в 4 руки нам не удалось это сделать. Использовала постаринке пищевую плёнку. ", "2020-10-20T19:11:23Z", "розовый", "0", 3, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "400": ["Взял 12 штук, удобная вещь, даже банки при консервиррвании закрываю [временно, конечно].\nМожно натянуть почти на что угодно. Термостойкие, не деформировались, без запаха, на ощупь гладкие, моются легко.", "2020-08-24T05:35:18Z", "розовый", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "405": ["Очень удобно, рекомендую к покупке.", "2020-10-18T17:40:18Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "406": ["Хорошие крышки,не заменимые на кухне.", "2020-10-18T11:58:36Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "407": ["Нужная в хозяйстве вещь, мягкие, тянутся.", "2020-10-17T11:52:17Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "412": ["Полное разочарование! Не держатся совсем, не «обнимают» посуду. Быстрее фольгой закрыть, чем стоять и 15 минут пытаться приладить крышку", "2020-10-15T15:01:47Z", "розовый", "0", 1, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "413": ["Хорошие крышки . Спасибо производителю и ВБ! ", "2020-10-15T14:19:25Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "414": ["Какие-то тонкие. Посмотрим как будут в использовании", "2020-10-15T09:02:31Z", "прозрачный", "0", 0, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "415": ["Крышки хорошие, но одна из крышек с браком. Поэтому возврат.", "2020-09-29T16:31:06Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "418": ["Брала маме, она очень довольна, использует не все размеры.", "2020-03-27T12:05:36.021144747Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "421": ["Очень хорошие крышечки!Достаточно эластичные для того,чтобы закрыть оставшиеся в тарелке подходящего размера или недопитый напиток в кружке,стакане.Они прекрасно заменили мне пришедшие в негодность пластиковые крышки от набора эмалированных контейнеров.Покупкой довольна,всем советую!", "2020-10-13T14:14:05Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "426": ["Сползают, не держатся, не особо растягиваются", "2020-10-12T18:38:43Z", "прозрачный", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "427": ["Ещё не проверяла.", "2020-10-12T12:28:47Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "431": ["По внешнему виду все  в порядке. Пока не пробовала в деле. Отзыв дополню. Но по мне очень тонкие.", "2020-09-07T16:42:59Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "433": ["на самом деле купила 3-х цветов, отличные крышки, даже не предполагала что будет так удобно ими пользоваться, места занимают мало, что для меня оч важно, спасибо производителю и магазину", "2020-10-10T09:05:21Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "435": ["Крышки - отстой. На посуде не держатся. Сползают! Из фикс прайса оказались в сто раз лучше!", "2020-10-09T08:05:59Z", "прозрачный", "0", 1, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "438": ["Замечательное изобретение)", "2020-10-08T10:56:41Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "440": ["Пришли целые, качество хорошее. Но! Когда надевпешь изначально, держится хорошо. Но достав из холодильника, сняв крышку, взяв из контейнера что вам надо, второй раз вы не оденет, крышка слетает! Видимо из-за того, что влажная становится....", "2020-10-07T08:59:12Z", "синий", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "441": ["Крышечки понравились! Сильно тянуть не рискую - прорвутся. Максимум на 2 см", "2020-10-07T03:02:49Z", "прозрачный", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "443": ["Мне не понравились, они не держаться на посуде. Крышки соскальзывают. И точно не растягиваются как написано в описании.  Пришла одна крышка грязная, даже не знаю чем.", "2020-10-05T18:28:41Z", "прозрачный", "0", 1, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "445": ["Крышки пришли без повреждений. Нужная вещь в хозяйстве. Рекомендую.", "2020-10-05T07:45:14Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "446": ["Присутствует запах, надеюсь выветриться. Я бы не сказала, что крепко сидят на посуде, попыталась закрыть чашу, под неё не подошла ни одна крышка  пришлось немного натягивать, она всё время соскальзывала, кое-как закрыла. Короче, я немного разочарована.", "2020-10-04T18:53:59Z", "светло-зеленый", "0", 0, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "447": ["Пока не поняла, но с пластикового контейнера сползает... Не держится! (  буду пробовать ещё, может я что то не так делаю...", "2020-10-04T18:14:58Z", "прозрачный", "0", 4, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "448": ["Крышки супер! Теперь вся посуда, которая редко использовалась из-за отсутствия крышек, снова в ходу. Единственный минус, они не растягиваются до указанных размеров, поэтому 4 звезды", "2020-10-03T17:56:02Z", "розовый", "0", 3, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "449": ["Крышки тонкие, но очень удобная вещь в хозяйстве. За такие деньги, пригодятся.", "2020-10-03T17:39:12Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "450": ["Крышки неплохие, но что то не на все тарелки и миски получается натянуть, может нужна сноровка. Буду пробовать использовать... ", "2020-10-03T17:27:09Z", "розовый", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "451": ["Крышки очень классные, для хранения в холодильнике идеальны, удобно, занимают мало места при хранении", "2020-10-03T12:33:11Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "452": ["Понравились, все целые, тянутся.", "2020-10-03T07:46:01Z", "розовый", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "453": ["Понравились. Качество отличное. Рекомендую", "2020-10-03T00:32:42Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "454": ["Данная таблица не соответствует реальности крышки тянуться тяжело и начинают постепенно слазить. И вообще не реально растянуть до максимального размера 🙄", "2020-10-02T18:21:28Z", "прозрачный", "0", 3, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "455": ["Крышки отличные, рекомендую!", "2020-10-02T12:37:25Z", "светло-зеленый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "456": ["Все нормально ", "2020-10-02T11:39:02Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "457": ["туфта. не тянется ноомально, не крепиться на посуде. не рекомендую", "2020-10-02T10:42:22Z", "синий", "0", 3, 3, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "458": ["Хорошо закрывают.", "2020-10-02T10:00:41Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "459": ["Давно хотела такие крышки,все не получалось, и вот теперь они у меня. По мне,так очень нужная вещь. Всегда думала как накрыть тарелки с едой,а теперь,крышку натянула и все в порядке и в холодильнике нет запаха еды", "2020-10-02T08:42:43Z", "розовый", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "460": ["Ерунда полная", "2020-10-02T06:22:19Z", "синий", "0", 3, 3, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "461": ["Крышки не понравились, с посуды соскальзывают, практически не растягиваются.", "2020-10-02T04:22:26Z", "синий", "0", 2, 2, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "462": ["Отличные крышки", "2020-10-01T18:32:23Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "463": ["У меня уже есть два комплекта подобных крышек других производителей, но там меньшие количества, как в штуках, так и по диаметру. Эти взяла ради трёх наибольших крышек, чтобы закрыть лотки, крышки от которых быстро лопнули, так и небольшие ковши и кастрюли. Пока всё устраивает. Случился, правда, перебор маленьких крышек, а больших хотелось бы побольше  (на заметку производителю).\n:-)", "2020-10-01T14:37:13Z", "розовый", "0", 6, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "469": ["Давно мечтала о таких, наконец-то заказала. Цвет салатовый. Советую сильно не растягивать, очень тонкий силикон, за это 4-ка а не 5-ка, думала, что он будет плотнее. Уже помыла и одну использую. В каком виде и упаковке поступило, сами на фото увидите.", "2020-09-29T17:31:46Z", "светло-зеленый", "0", 2, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "471": ["Прикольные крышки.", "2020-09-29T16:31:27Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "473": ["Крышки отличные, сильно не растягиваются, но на посуду по размеру очень удобно. Не имеют посторонних запахов. Я довольна.", "2020-09-29T00:55:34Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "476": ["Хорошие крышки, самая маленькая подошла для стакана 8 см диаметр, а самая большая на салатницу 21 см. На арбуз не налезло.\nЗапахов нет, хорошо упаковано.", "2020-09-28T15:19:45Z", "прозрачный", "0", 10, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "478": ["Супер крышки, очень классно и удобно", "2020-09-27T09:37:09Z", "розовый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "483": ["Товар хороший, прочный и цвет приятный, только одну звезду уберу за то, что на 4 ёмкости не смогла одеть как надо, вернее они соскальзовали обратно, я сделала вывод, что не на все они подходят. А так не плохо может когда нибудь пригодятся.", "2020-09-26T08:18:08Z", "розовый", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "487": ["Хорошие крышки. Силикон.", "2020-09-18T17:43:48Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "489": ["Описание не соответствует, крышки почти не растягиваются. После первого использования остаются растянутыми, теряют эластичность.", "2020-09-25T17:25:37Z", "прозрачный", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "490": ["Всё хорошо", "2020-09-25T13:40:44Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "491": ["Честно, даже оценивать не хочется... Не пойму вообще, как такими крышками можно что-то накрыть... Они не растягиваются до нужных размеров, как заявлено на упаковке, более того, они сползают, не держатся... Деньги на ветер... Кое как натянула на контейнер.. В общем, нужно приложить немало усилий, чтобы саму крышку растянуть (того и гляди, треснет по швам). Сковороду 28 см не накрывают. Фото прилагаю", "2020-09-25T09:07:32Z", "синий", "0", 2, 2, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "494": ["Нормальные крышки, пригодятся. Пользоваться буду, но без натяжки на больший диаметр, макс. на 1 см.", "2020-09-24T04:34:29Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "496": ["Классные, возьму ещё", "2020-09-23T15:21:30Z", "прозрачный", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "502": ["Крышки хорошие. Только учтите, что растягиваются максимум на 1 см. То есть самая большая крышка из набора - 21 см. А так очень удобные и практичные", "2020-09-22T19:03:52Z", "светло-зеленый", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "503": ["Крышки так себе, до заявленного диаметра не тянутся, разве что чуть больше собственного диаметра. Сгодятся.", "2020-09-22T18:22:15Z", "розовый", "0", 1, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "505": ["Сняла звезду, так как прислали не тот цвет, но заморачиваться с обменом не захотела. Пока довольна, что будет дальше не знаю. Очень удобные.", "2020-09-22T09:14:11Z", "розовый", "0", 0, 2, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "506": ["Плохо натягивать", "2020-09-17T08:54:15Z", "розовый", "0", 1, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "508": ["Плохо растягивается.Качесство нормально.", "2020-09-21T20:03:54Z", "розовый", "0", 0, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "509": ["Растягиваются не так сильно как в рекламе, но действительно выручают когда нет \"родной\" крышки", "2020-09-21T17:45:10Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "510": ["В целости,сохранности, понравились", "2020-09-21T15:11:29Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "511": ["Качественные крышки российского производства. За 200 р отличное приобретение. Спасибо большое производителю.", "2020-09-21T13:53:52Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "512": ["Не натягиваются на посуду большего диаметра!", "2020-09-20T17:41:56Z", "розовый", "0", 1, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "513": ["Практичная и нужная вещь", "2020-09-20T16:19:46Z", "светло-зеленый", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "514": ["Класс. Хорошее качество", "2020-09-20T16:07:32Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "515": ["Не надеваются на заявленные размеры, сползают, одна при первой примерке порвалась сразу", "2020-09-20T15:56:09Z", "прозрачный", "0", 4, 2, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "516": ["Хорошие крышки", "2020-09-20T12:26:32Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "517": ["Классные, очень удобные. Хорошо тянутся. Супер! Рекомендую 👍 Кстати на прозрачных крышках тоже есть смайлики)", "2020-09-20T07:09:52Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "518": ["Отличные крышки, советую", "2020-09-20T06:21:37Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "519": ["Деньги на ветер! Если даже и натягиваются , то через пару минут сами по себе сползают и открываются.Ерунда!", "2020-09-20T00:12:33Z", "синий", "0", 3, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "520": ["Полная хрень...не натягиваются, если надевать чуть большего размера сползают..не тратьте деньги!!!", "2020-09-19T20:13:11Z", "розовый", "0", 3, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "522": ["Крышки не понравились , жесткий силикон, плохо растягиваются. ", "2020-09-16T04:13:45Z", "светло-зеленый", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "524": ["Первое, что бросилось в глаза упаковка. Ее нет. Вообще нет. Просто прозрачный пакет, который ещё и плохо запечатан. Крышки не тянутся по написанным размерам. Покупкой удовлетворена", "2020-09-19T14:17:46Z", "розовый", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "527": ["Очень удобные штучки, главное не занимают места в холодильнике", "2020-09-18T14:25:35Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "528": ["Очень удобные. В ходу оказались все. Буду заказывать ещё, теперь для дачи.", "2020-09-18T11:12:36Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "529": ["Классный 👍👍👍", "2020-09-04T04:20:14Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "536": ["Беру во второй раз.Нравится, очень удобно", "2020-09-16T07:03:50Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "537": ["Очень нужная вещь, и как я без них обходилась раньше? Удобно, красиво, незаменимо", "2020-09-15T17:53:47Z", "розовый", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "538": ["Крышки пришли запечатанные в упаковке. Но,на арбуз,самую большую крышку натянуть не смогла. Наверное,нужна какая-то Снаровка, Закалка, Тренировка !Всем удачи.", "2020-09-15T16:12:37Z", "розовый", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "540": ["Очень понравились крышки! Спасибо производителю!", "2020-09-15T12:52:10Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "541": ["Заказом довольна, крышки силиконовые, держаться на посуде хорошо.", "2020-09-15T11:58:14Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "542": ["Покупаю уже претий набор, прелесть", "2020-09-15T11:03:25Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "544": ["Качество соответствует", "2020-09-15T04:18:50Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "545": ["Хорошие, прочные.", "2020-09-14T15:30:17Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "547": ["Прикольно. Дыню можно прятать в холодильник теперь )", "2020-09-14T11:19:50Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "548": ["Очень понравилось, крышки супер, заказала ещё. Запаха нет. Рекомендую.", "2020-09-14T08:12:13Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "551": ["Полная ерунда, со скальзывпет с любой посуды, приобретать не советую☹️", "2020-09-12T15:03:16Z", "прозрачный", "0", 4, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "556": ["Крышки хорошего качества, тянутся очень хорошо. На посуде держатся крепко, не сползают. Самое главное то, что их можно надеть на посуду любой формы, даже квадратной или прямоугольной. Очень удобно. Размеры универсальные, под различный диаметр. Здорово, что можно одеть на фрукты. Раньше разрезанный арбуз хранить была целая история, а сейчас одел крышечку и порядок. Ничего не течёт и незаветривается. Цвет яркий. Понравились, рекомендую. Брала белые, а теперь взяла розовые и синие.", "2020-09-11T11:01:26Z", "синий", "0", 7, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "557": ["хорошие симпатичные крышки,эластичные", "2020-09-11T08:13:53Z", "розовый", "0", 0, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "558": ["Крышки неплохие, но ставлю тройку за то, что обманули-не тянутся они настолько, как заявлено. А нужна была именно на 28 см, облом.", "2020-09-09T14:40:38Z", "розовый", "0", 4, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "560": ["Качество хорошее.  Очень удобная вещь на кухне. Советую", "2020-09-08T16:26:18Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "561": ["Отличные крышки. Рекомендую. На посуде держатся хорошо.", "2020-09-08T06:50:09Z", "розовый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "562": ["Не растягивается на заявленный размер, не держится. Большая крышка заявлена до 28 см. Натянуть не на 28, ни на 26 не получилось. В четыре руки натянули на кастрюльку 23 см в диаметре. Отпустили. Результат вы видите. Выброшенные деньги. Не рекомендую!", "2020-09-07T16:43:27Z", "розовый", "0", 9, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "564": ["Я не могу поставить высокую оценку, так как бесполезная покупка , держится только на овощах, с посуды соскальзывает. ", "2020-09-06T17:11:53Z", "прозрачный", "0", 5, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "565": ["Крышки понравились. Удобные, тянутся умеренно. Но используются по большей части самые маленькие, большие пока не пригодились", "2020-09-05T04:32:00Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "566": ["Крышки классные,НО надо ещё подобрать для них посуду.", "2020-09-04T13:33:27Z", "розовый", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "567": ["Мягкие, хорошо натягиваются на банки", "2020-09-04T05:47:40Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "568": ["Волшебные крышечки! Мои первые помощники на кухне! Качество отличные, они эластичные, подходят на квадратную посуду. У дочки такие же другого производителя, но они дубовые и неудобные.\nСпасибо большое производителям!", "2020-09-03T17:35:44Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "569": ["Удобная, на все натягивающаяся. Без запаха. Буду еще заказывать.", "2020-09-03T07:23:39Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "570": ["Крышки так себе на троечку, хотела надеть на арбуз, соскакивает, не ко всей посуде подходит.", "2020-08-31T19:16:47Z", "розовый", "0", 3, 3, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "573": ["Очень разочарована. Жаль денег. Совершенно не держатся на посуде с ровным краем.", "2020-09-02T08:32:37Z", "розовый", "0", 5, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "574": ["Не очень, не растягиваются.", "2020-09-02T05:23:13Z", "розовый", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "575": ["Крышки ни чего так пойдут. Размер у продавца заявлен правильный, но каждая крышка на свой размер посуды, они не расстягиваются. Думала самая большая подойдёт для кастрюльки от мультиварки, но увы. Оказалась маловата. ", "2020-09-01T13:32:36Z", "светло-зеленый", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "576": ["Крышки классные, удобные!!!", "2020-09-01T10:19:39Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "577": ["Плохой набор. Самое мелкая крышка не налазит на стандартные горлышки банок стекляных (от закаток). А следующая уже очень большая. Нереально обидно, только ради одной и купила, теперь будут лежать зазря(", "2020-08-31T15:05:16Z", "светло-зеленый", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "578": ["Крышки не очень хорошего качества. Плохо тянутся и не держаться.", "2020-08-31T14:12:46Z", "прозрачный", "0", 6, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "583": ["Качество хорошее. Не смогла оценить по назначению. С тарелок соскальзывают, на большие диаметр натянуть не реально. Идут практически на свой размер, сильно не натянешь. Немного расстроена.", "2020-08-30T07:33:12Z", "светло-зеленый", "0", 3, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "584": ["Пустая трата денег.они не растягиваются до того размера,как пишут.", "2020-08-28T10:06:24Z", "розовый", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "589": ["Крышки прикольные. Резина плотная, но эластичная. Действительно непроливайки. Единственное нужно приноровиться их натягивать, а так прям стоят того чтобы купить.", "2020-08-27T05:06:21Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "593": ["Пустая трата денег 🤦‍♀️\nНе на что не подошли. На чайную чашку большое, на тарелку малое на арбуз маленькое. Естественно все смотрела, подбирала и одевала по диаметру.Наверное Русская посуда не годится для китайских крышек 😄", "2020-08-25T03:05:20Z", "розовый", "0", 2, 4, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "594": ["Крышки классные\n.. Но заказывала розовые а пришли синии...", "2020-08-22T09:40:03Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "595": ["Очень удобно!", "2020-08-22T06:59:46Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "596": ["Крышки хорошие. Плотные, качественные, подходят к большинству посуды. Покупала бабушке, ей понравились😄 брали зелёные - она у меня любит зеленый😊", "2020-08-21T19:26:56Z", "светло-зеленый", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "597": ["Хорошая вещь. Согласна с некоторыми предыдущими отзывами, что тянутся умеренно. Размер нужно подбирать. Практично, мне нравится. Брала зелёные, а пришли ядерно-зеленые))", "2020-08-20T17:58:12Z", "светло-зеленый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "598": ["Брала себе и маме, розовые и светло-зеленые. Постоянно пользуемся, очень удобно. Ни с какими обычными крышками от кастрюль или тарелками не сравнить. можно ставить тарелки друг на друга, крышки эти выдерживают. ничего не испаряется в холодильнике, не заветривается.\r\nОднозначно рекомендую к покупке.", "2020-08-19T20:21:30Z", "розовый", "0", 8, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "599": ["Трудновато натягиваются. Посмотрим, как долго протянут", "2020-08-19T10:08:20Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "600": ["Разочарование полное! Очень неудобные, плохо тянущиеся и очень плохо держаться на посуде! Не зря уценили😁", "2020-08-18T11:40:12Z", "светло-зеленый", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "601": ["Удобная для кухни вещь. Растягиваются умеренно, нужно подбирать адекватно размер.Сомневаюсь, конечно, что можно на арбуз натянуть в силу диаметра😁 Но для чашек и мисок самое то) Покупала коллеге, теперь себе и маме закажу)", "2020-08-18T09:02:31Z", "прозрачный", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "603": ["Отличный товар, купили 3 комплекта разных цветов, очень помогают в хозяйстве🤗", "2020-08-17T10:25:03Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "604": ["Ничего они не растягиваются. Особенно маленькой и большой применения нет", "2020-08-17T04:43:31Z", "синий", "0", 1, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "605": ["Не сказала бы, что хорошо тянутся. Крышка номер 5, заявлено что 16 см растянутся до 24, но по факту не растягивается даже накрыть салатник диаметром 21 см. Растянуться-то может и растянется, но не удержится на посуде точно, моментально съезжает. Может, потому что слишком тонкий материал. Мне нужны были 2 больших крышки (21см), только ради этого брала комплект. В итоге получила одну нужную крышку и кучу маленьких ненужных. В общем, информация по размерам от производителя недостоверная.", "2020-08-16T23:29:24Z", "прозрачный", "0", 6, 2, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "606": ["Даже одной звезды жалко ужасно деньги на ветер", "2020-08-16T06:25:42Z", "прозрачный", "0", 1, 2, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "608": ["Классные крышки, тянутся", "2020-08-15T03:00:57Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "609": ["Крышки классные, нужная вещь 👍🏻", "2020-08-14T17:13:49Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "610": ["Крышки классные, качественные.", "2020-08-12T20:20:39Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "611": ["Крышки отличные, на большой арбуз конечно не натянутся но в хозяйстве очень нужная вещь ", "2020-08-12T18:08:45Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "613": ["Мне крышки нравятся. Сначала заказала маме, потом себе. Пользоваться просто и удобно. Непонятны негативные отзывы: на что их натягивают, что они рвутся?? Если пользуешься аккуратно, то никаких проблем. Занимают минимум места, я их переложила салфеточками. Смело рекомендую!", "2020-08-12T13:34:58Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "614": ["Совершенно бесполезная вещь.", "2020-08-12T06:15:46Z", "светло-зеленый", "0", 0, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "615": ["Необходимая вещь  советую", "2020-08-11T04:33:41Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "616": ["Ерунда,а не крышки,подходят только каждая под определенный размер,практически не тянутся,постоянно соскальзывают,я у себя на кухне не нашла где их толком применить,выкинутые на ветер 300 рублей.", "2020-08-10T15:09:01Z", "розовый", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "621": ["Крышки не понравились,тянутся,но соскальзывают с посуды.Покупкой недовольна.", "2020-07-30T18:31:49.371790229Z", "прозрачный", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "622": ["Брала на подарок к 8 марта маме и свекрови. Они оценили удобство. Беру теперь и себе.", "2020-07-30T15:21:15.905056522Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "623": ["Прикольные крышки.Закрыла стакан с водой,не протекает.Очень удобно!", "2020-07-29T10:13:50.316910941Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "624": ["Пришли целые. Покупкой довольна. Как будут в эксплуатации, посмотрим. Удобная вещь на кухне.", "2020-07-29T07:50:41.86414622Z", "прозрачный", "0", 1, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "625": ["Удобные и весёлые крышки:) Мариновала мясо, крышка у ёмкости отсутствовала и данный набор очень помог!", "2020-07-28T15:24:01.701805194Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "628": ["Отличные крышечки. Пришли в целости без брака. Не пахнут.", "2020-07-27T17:55:26.478776055Z", "прозрачный", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "631": ["Крышки замечательные. Использую их с удовольствием. Удобные в применении, а главное, не надо перекладывать из одной посуды в другую, просто закрываю силиконовой крышкой и все. Можно в микроволновке разогревать и в морозильник ставить. Советую приобрести. Я еще заказывать буду, теперь для детей", "2020-07-17T12:31:47.213462161Z", "прозрачный", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "633": ["Крышки супер. Тянуться хорошо. Суперские.", "2020-07-23T02:02:34.992223195Z", "розовый", "0", 6, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "635": ["Купила два комплекта- себе и маме. Пока у нас только положительные впечатления. Начитались отзывов и стали натягивать крышки на все салатники и мисочки в доме. Все нормально. Натягиваются без проблем. Главное натягивать сухие крышки на сухую посуду и не очень сильно тянуть, а подбирать по размеру, указанному в инструкции. Покупкой довольны.", "2020-07-19T15:26:57.596131067Z", "синий", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "636": ["Классные 👍🏼", "2020-07-17T05:23:42.174919541Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "637": ["Тонковаты. Но пользоваться удобно. Сильно не растягиваю", "2020-07-16T12:50:06.703342659Z", "синий", "0", 0, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "638": ["Спасибо, крышечки хорошие, взяла в подарок маме, нам бонусом попалась упаковка с семью крышечками.", "2020-07-16T10:27:10.027732737Z", "синий", "0", 0, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "639": ["Крышки в эксплуатации уже месяц. Хорошо тянутся. Лучше приобретать сразу 2-3 набора, т.к силиконовые крышки разного диаметра. ", "2020-07-15T20:14:41.973981881Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "641": ["Хорошие крышки, ровные, без дефектов. Для сравнения на фото крышки от разных продавцов (слева от другого магазина, дешевле на 20 руб.). Также имейте в виду, что такие крышки не держатся на посуде большего диаметра - сползают. ", "2020-07-09T14:48:30.101136616Z", "прозрачный", "0", 11, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "642": ["Крышки хорошие, но как указано на упаковке, что они растягиваются до определённых размеров, не смогли растянуть и закрыть, только под размер пользоваться ими", "2020-07-07T07:23:23.489119125Z", "прозрачный", "0", 2, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "643": ["Хорошие крышки - без дефектов ", "2020-07-07T05:03:49.412264287Z", "светло-зеленый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "644": ["Крышки хорошие, подошли почти на все мисочки и плошки.", "2020-07-04T17:09:03.413045558Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "645": ["Бесполезны. Чтобы надеться на емкость диаметр должен полностью совпадать: не тянутся. Ни на кружку, на на стандартную глубокую тарелку, ни на что не налезли. Ну так, поиграть и выкинуть. Как и формы для оладьев) убедилась, что такие предметы можно покупать, только если лично убедишься на практике, что они годны. ", "2020-07-03T11:04:04.272333196Z", "розовый", "0", 7, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "646": ["Не оправдали своих ожиданий! Плотность материала на крышке отличается, где-то толще, а где-то совсем тонкая. Кто-то спрашивал, а наденутся ли они на арбуз? Ответ- нет, даже самая большая крышка маловата для арбуза... описание абсолютно не соответствует, крышка 20 см не растянется до 28 см. Не тянутся они совсем!", "2020-07-02T20:39:33.50223238Z", "светло-зеленый", "0", 8, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "647": ["Отличные крышки! Очень удобно и лично у меня не рвутся ", "2020-07-02T10:57:06.412085612Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "648": ["Отличные крышки. Продавца рекомендую.", "2020-07-01T09:58:12.018927007Z", "светло-зеленый", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "650": ["Заказала два комплекта синие(себе), св.-зеленые(сестре)! В тот же день испробовала и полное разачарование, если даже натянуть,  крышку на диаметр к которому она  подходит, то крышка сползает, а если большую крышку натянуть на меньший диаметр, то тогда держиться, но так себе! Видимо они должны быть не из такого качества материала! Вернулась к пищевой пленке!", "2020-06-28T15:20:32.885245325Z", "синий", "0", 7, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "651": ["При открытии пакета немного пахнут. Степень растяжки не плохая, заезду сняла только из-за того, что размер несколько разочаровал - самая большая оказалась на среднюю мисочку, даже не на большую. На сковородку 20 см не надеть.", "2020-06-28T05:03:08.121256481Z", "синий", "0", 6, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "652": ["Отличные крышки! Заказывала бабушке, она в восторге. Хорошо тянутся, моются.", "2020-04-29T03:24:51.506739798Z", "прозрачный", "0", 5, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "654": ["Крепкий силикон, тянется отлично. Рекомендую.", "2020-06-26T11:15:54.503080192Z", "светло-зеленый", "0", 0, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "655": ["Очень удобные крышечки, пользуюсь постоянно, заказала аж 5 комплектов, совместная покупка😀", "2020-06-24T15:35:24.986198921Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "657": ["С виду отлично, в деле будет видно", "2020-06-23T12:30:27.467899892Z", "светло-зеленый", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "659": ["Не держатся. Натягиваю -- они сползают и падают в суп ((", "2020-06-22T18:57:25.943218078Z", "розовый", "0", 6, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "660": ["Совсем не тянутся. Не стоит своих денег. Не оправдало   жаль что не могу вернуть.", "2020-06-21T10:58:24.416794914Z", "синий", "0", 3, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "662": ["Чудесные крышки, без запаха, плотненько запечатывают! Давно искала крышку на 5-литровую банку, жаль, что пришлось купить целый комплект, но, думаю, пригодятся!", "2020-06-14T08:59:36.459868791Z", "светло-зеленый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "663": ["Отличные крышки, без запаха", "2020-06-10T12:27:45.586191834Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "664": ["Хорошо надеваются на посуду, но одна порвалась со второго применения.", "2020-02-17T13:52:41.454722486Z", "синий", "0", 6, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "666": ["Крышки супер, беру не первый раз. Рекомендую. Очень доволен.", "2020-06-09T13:15:07.914739018Z", "светло-зеленый", "0", 1, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "667": ["Крышки прикольные, можно натянуть на разные ёмкости. Как будут в эксплуатации незнаю.", "2020-06-09T08:28:56.449474569Z", "светло-зеленый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "668": ["Удобные многоразовые крышки. В хозяйстве пригождаются постоянно.", "2020-06-08T16:46:47.18861717Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "669": ["Крышки очень ь понравились. Тянутся хорошо. Форму держат", "2020-06-08T13:10:01.67492229Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "670": ["Понравились. Заказала такой же набор родителям.", "2020-06-08T12:19:09.013280628Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "671": ["Чудные крышки. Удобные. Доставка быстрая.", "2020-06-08T09:03:29.142672021Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "672": ["Спасибо, товар дошёл. Буду пользоваться. Тянутся крышки хорошо.", "2020-06-07T15:41:25.955299855Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "673": ["Довольна,выручают", "2020-06-06T11:44:30.421039858Z", "розовый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "674": ["Все хорошо", "2020-06-04T07:42:33.186293776Z", "прозрачный", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "675": ["Пока не поняла. Попробовала закрыть салатницу, отвалилась. Размеры совсем не подходят ни к чему. Либо мало. Либо очень велико. Думаю, что найду применение....", "2020-02-25T16:13:15.997800008Z", "светло-зеленый", "0", 12, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "677": ["Не удается натягивать, все время соскальзывают. Пожалела что купила", "2020-05-17T15:22:03.500730217Z", "розовый", "0", 5, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "678": ["Хорошие штучки.Держатся хорошо.", "2020-05-16T06:32:44.473356389Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "679": ["Не очень, одна порвалась. Очень плохо растягиваются", "2020-05-09T17:48:54.246529423Z", "синий", "0", 4, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "680": ["Очень понравились, удобные", "2020-05-04T05:10:16.72688547Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "681": ["Нам не понравилось, просто соскальзывает с любой посуды, если только прикрыть, но хотелось именно , чтоб закрывали, брала другие, те действительно натягиваются и закрывают ... а эти ... разочаровали", "2020-04-22T10:09:55.647066928Z", "светло-зеленый", "0", 5, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "682": ["Идея хорошая, исполнение плохое. Сразу показались хлипкими ( видно на втором фото, неровная бугристая поверхность.эта крышка не была в употреблении,самый большой диаметр,лежит без дела) Так вот , на первом фото видно,что с ними происходит при использовании.При растяжении силикон белеет, как будто рязина старая.( Сфоткала ,как смогла, одной рукой) Много видела силиконовых пустышек и ложек и трубочек детских, специально их тянула, они прозрачные как слеза) Скажу так, если кто-нибудь покажет где продают качественные крышки ,с более толстым слоем силикона,обязательно куплю.", "2020-04-10T10:25:06.921554921Z", "прозрачный", "0", 21, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "683": ["Удобные, практичные  - настоящие помощницы на кухне. Рекомендую!", "2020-04-09T12:33:11.35052977Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "685": ["Порвались быстро,если первый можно было подумать из-за неаккуратности,то остальные одевались бережно.Но задумка хорошая", "2020-03-28T08:20:25.288622265Z", "синий", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "686": ["Спасибо тому, кто придумал эти крышки. Дажу мужу понравились в испрльзовании", "2019-12-19T15:17:00.263190781Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "688": ["Отличная штучка. Решена проблема с накрыванием салатников после застолья. Натянула и убрала в холодильник.", "2020-03-24T10:50:30.298814942Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "689": ["Оооочень хороши. Удобные и не только на круглые емкости. Расстроилась после того, как увидела из в Светофоре за 167 руб.", "2020-03-22T09:01:47.874073642Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "691": ["Нужная вещь в хозяйстве. Качество на уровне 👍🏻Сняла звезду за то, что нет большего диаметра (например, для средней кастрюли либо Арбуза) ", "2020-03-21T18:40:51.941162604Z", "синий", "0", 1, 1, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "693": ["Крышки не растягиваются как пишут,одну сторону натягиваешь, с другой соскальзывает. Не понравились!", "2020-03-18T13:48:19.267422124Z", "прозрачный", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "695": ["Крышки очень удобные! Ничего не соскальзывает, как многие пишут, главное  подобрать подходящий размер. Тянутся хорошо! Я очень довольна и цена смешная всего 310 рублей.", "2020-03-16T06:00:54.356966899Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "698": ["Отличные крышки, легко натягиваются, фото прилагаю.Спасибо магазину.Очень довольна.", "2020-03-12T12:08:59.459514527Z", "розовый", "0", 5, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "700": ["Не знаю кому как, а мне крышки не понравились, не натянешь их они сползает, или большие, под банки ни одна не подходит, короче ерунда", "2020-02-13T11:40:46.774477805Z", "светло-зеленый", "0", 7, 3, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "704": ["Отличные крышки! Беру не первый раз. Сейчас брала в подарок.😊😊😊", "2020-03-07T18:21:24.70193205Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "705": ["Крышки классные, не пахнут, мягкие, эластичные, очень удобные", "2020-03-06T17:05:01.878187798Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "707": ["Замечательные крышки. Люблю стекляные салатники. Эти крышки то что надо к ним. Самая маленькая хороша на баночку консервную\n Рекомендую.", "2020-03-03T05:01:44.498970437Z", "синий", "0", 11, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "708": ["Крышки классные, легко натягиваются на салатницы и т.д. жидкость не продлевается. Рекомендую.", "2020-02-27T20:28:54.464826119Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "710": ["Удобная штука. Но материал совсем тоненький, страшно порвать", "2020-03-02T10:56:05.273765279Z", "розовый", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "714": ["Как-то неудобно,не натягиваются или слезают,возможно если размер у посуды такой как крышка,но тогда в чем прикол?", "2020-02-28T15:27:57.132732758Z", "прозрачный", "0", 1, 0, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "715": ["Крышки не держаться на посуде. Деньги на ветер, очень жалею что купила их. ", "2020-02-28T13:14:56.079675765Z", "прозрачный", "0", 2, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "716": ["Не советую. Растягивается плохо и не держится на посуде", "2020-02-27T12:24:38.46359505Z", "прозрачный", "0", 2, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "719": ["Крышки соответствуют описанию, но мне не очень понравились. Купила их взамен к круглым лоточкам, на которых  их родные крышки вышли из строя. Но... 2 самые маленькие крышечки  только на чашку... остальные пока натянешь так чтобы не сползали .... вообщем пользоваться , конечно , я буду, но без особого энтузиазма)))))", "2020-02-22T18:16:40.984657396Z", "светло-зеленый", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "722": ["Понравились.   Заказала ещё.", "2020-02-21T13:54:40.496341222Z", "розовый", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "726": ["Не жалею, что приобрела. Пользуюсь уже 2 месяца каждый день, очень удобно.", "2020-02-16T08:42:55.556927407Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "728": ["Крышечки замечательные! Беру второй набор. Очень хорошо растягиваются, герметично закрывают .Спасибо производителю за качественный товар!", "2020-02-13T14:15:23.999089985Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "733": ["Хорошие крышки. На банку всего лишь подходит одна. Остальные большие, но будем пробовать примерять везде. Плотные, на банку  ,крышка,оделась хорошо. Вообщем, довольна.", "2020-02-11T14:14:36.30755617Z", "розовый", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "734": ["Клевая штука!!!!!!! Зачёт!!!!! Очень пригодились", "2020-02-11T12:27:27.561371348Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "735": ["Все целое хорошо упаковано. Мягкие тянутся\nНо пока еще не поняла насколько полезны в использовании", "2020-02-11T11:40:00.34540448Z", "синий", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "736": ["Крышки взяла попробовать, даже не знала, что такие бывают. Натянула самую маленькую на лимончик, еще две на салатницы, проверила, что они реально держатся и не сползают, приятно удивлена, спасибо магазину", "2020-02-10T16:54:07.306720205Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "737": ["Как заявлено все", "2020-02-09T05:38:40.940161896Z", "синий", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "738": ["Крышки пришли упакованные, прозрачные, как и заказывала. Спасибо магазину!!!", "2019-12-16T09:00:29.972811241Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "741": ["Крышки хорошие,но у  кого ногти аккуратно -рвутся.", "2020-02-04T04:20:34.095002744Z", "прозрачный", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "742": ["Замечательные крышки", "2020-01-28T21:46:16.648765295Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "743": ["Крышки, замечательные, находка для хозяйки. Хорошо растягиваются, запаха нету, ну просто супер, рекомендую всем кто ещё не купил.", "2020-01-28T07:07:05.509845855Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "744": ["Крутые крышки, советую", "2020-01-27T09:16:26.579049202Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "745": ["Крышки отличные, силикон не пахнет, легко натягиваются на посуду. Очень удобно для салатников.", "2020-01-26T06:42:45.357795861Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "746": ["Очень тонкие с посуды соскальзывают", "2020-01-26T04:17:18.215166326Z", "синий", "0", 2, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "747": ["Хорошие крышки, хорошо растягиваются, отлично моются. Пользуюсь часто. Можно поставить друг на друга посуду с этими крышками при условии хорошей натяжки. Рекомендую.", "2020-01-25T10:38:22.997222814Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "748": ["Крышки классные! Подходят ко всем моим чашкам и кастрюлям.", "2020-01-23T09:15:44.133831335Z", "прозрачный", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "749": ["Покупалось в подарок маме. В большинстве впечатления положительные, но не все крышки растягиваются до заявленных размеров.", "2020-01-23T03:56:53.101840541Z", "синий", "0", 4, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "750": ["Отличный набор. Покупала подруге. Себе закажу обязательно.", "2020-01-05T20:03:41.46903954Z", "синий", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "752": ["Отлично!!!Все крышки без брака,материал плотнее чем у другого производителя (если интересно см.историю моих покупок)...", "2020-01-21T12:15:43.093604066Z", "синий", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "754": ["Крышки отличные, покупаю второй набор. Силикон плотный, прозрачный, чудо не ждите растягивается в рамках своего размера.", "2020-01-20T18:20:18.461419002Z", "синий", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "755": ["Удобно от заветривания продуктов и не пропускают запах пищи. Приноровилась надевать не сразу, соскальзывают при надевании. Советую натягивать крышки только сухие и сухими руками. Покупкой довольна. Спасибо.", "2020-01-18T16:21:26.915130242Z", "синий", "0", 9, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "756": ["Самая нужная по диаметру крышка через 2 недели бережного и не активного  использования порвалась(", "2020-01-17T14:04:36.752680371Z", "прозрачный", "0", 1, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "757": ["Очень удобные крышки я довольная  у меня в ходу аж 3 набора. Также для подарков подойдут. такие крышечки должны быть у хозяек.", "2020-01-17T11:28:17.158710567Z", "синий", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "758": ["341₽. Все целые .", "2020-01-16T10:50:04.24506175Z", "синий", "0", 5, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "760": ["Очень нужная вещь в хозяйстве!!! Рекомендую.", "2020-01-12T05:38:40.176941817Z", "синий", "0", 1, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "761": ["Все целое пришло!очень удобные в использовании.", "2020-01-09T15:39:41.173651617Z", "синий", "0", 5, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "763": ["Одна из крышек порвалась при первом использовании. Возможно был дефект при производстве: более тонкий материал или дырка. Остальные крышки растягиваются нормально. В целом приобретением довольна.", "2020-01-08T11:17:38.771280761Z", "прозрачный", "0", 4, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "765": ["Всё хорошо. Растягиваются не сильно ожидали большего, но брать можно удобная штука", "2020-01-05T16:47:20.269604207Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "769": ["Работает, но сильно растянуть не получится.", "2020-01-03T14:56:19.366722976Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "770": ["Отличная вещь! Удобно в использовании! Пришли без брака.", "2019-12-20T14:56:02.519363894Z", "прозрачный", "0", 14, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "772": ["У нас посуда \"неправильной\" формы (волнистые края) и не знали чем закрыть остатки для хранения в холодильнике - прям то что нужно! Спасибо производителю и магазину!", "2019-12-29T11:54:56.088374915Z", "синий", "0", 10, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "773": ["Всё классно соответствует, только огорчилась по поводу цены, зашла вчера а отдел ТВ шоп, так там такие же крышки ровно в половину дешевле☹️, а качество тоже.... (Тут 2070 тг, там 1050тг)", "2019-12-29T01:30:39.422323229Z", "синий", "0", 3, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "774": ["крышки понравились, тянутся хорошо, я довольна, второй комплект взяла в подарок", "2019-12-27T18:09:34.966046785Z", "прозрачный", "0", 1, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "775": ["Заказала крышки синего цвета и прозрачные. Должны были придти 20.12, а уведомление пришло 23.12 и смс на телефон. Пошла выкупать 25.12, а мне говорят товара НЕТ! Вы издеваетесь?", "2019-12-25T10:55:37.179719602Z", "синий", "0", 1, 6, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "776": ["Крышки оказались не качественные, один край плотный, другой совсем тонюсенький. На самой большой крышке вообще дырка.  Поэтому отказ", "2019-12-24T17:06:19.152618404Z", "синий", "0", 5, 1, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "777": ["Прочитав много отзывов, тщательно проверяла крышки на наличие брака, НО товар пришел идеальный. Пробавала и на круглые и на прямоугольные формы, крышуи свои функции выполняют на отлично. Всем советую", "2019-12-24T14:08:59.794218332Z", "прозрачный", "0", 9, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "778": ["Отличные крышки, тянутся хорошо, запаха нет от них, понравились.", "2019-12-23T14:43:43.475888694Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "779": ["Нормальные крышки, тянутся хорошо. Но оказалось, что можно найти практически в любом магазине в несколько раз дешевле", "2019-12-21T09:04:11.694596581Z", "прозрачный", "0", 9, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "780": ["Крышки если честно нельзя назвать универсальными они обычные только мягкие и нужно подбирать размер посуды для каждой крышки чтобы посуда была немного больше крышки тогда крышка нормально сидит, отказ из за отсутствия универсальности , но одну для разнообразия когда нибудь закажу одну для обычной тарелки а набор это много.", "2019-12-21T09:02:18.733813171Z", "синий", "0", 6, 2, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "781": ["Запаха нет. Согласна\n Но примерка на чашу мультиварки закончилась печально.", "2019-12-20T17:49:15.405238777Z", "прозрачный", "0", 6, 1, 2, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "782": ["Хорошие крышки , удобные, но уж больно нежные. Пока рассматривали, ребёнок проткнул прям на глазах, причём совершенно не преднамеренно.   А так действительно удобно", "2019-12-20T16:38:38.800391833Z", "синий", "0", 4, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "783": ["Крышки отличные, растягиваются замечательно! Без запаха. Рекомендую!", "2019-12-20T15:52:18.983998629Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "784": ["Классные штучки, пришли все целые, без каких либо дырочек как пишут в отзывах. Рекомендую. ", "2019-12-13T09:32:25.449186021Z", "синий", "0", 2, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "786": ["Очень удобная вещь. Запаха нет. Растяжимость умеренная.", "2019-12-20T14:55:13.970331552Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "787": ["Пришли в скрытом пакете, но все крышки целые. Хорошо натягиваются.", "2019-12-19T13:00:11.421236718Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "788": ["Отличные крышки.\r\nНе плохо бы было если бы наборы были разные. Например: по две-три одинаковые или ещё какое-нибудь сочетание. ", "2019-12-18T21:36:30.043608094Z", "прозрачный", "0", 6, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "789": ["Пустая трата денег! На банках не держаться а одна крышка оказалась дырявая и когда попыталась ее установить совсем порвалась!", "2019-12-17T07:05:56.513336072Z", "синий", "0", 1, 2, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "790": ["Крышки классные,  мягкие, пришли целые. Очень удобные. Рекомендую.", "2019-12-15T12:46:50.581574105Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "791": ["Классные крышки, рекомендую)", "2019-12-13T18:45:44.851713774Z", "прозрачный", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "792": ["Довольна пакупкой ешо не пробовала там посмотрем ", "2019-12-13T13:29:32.433414444Z", "синий", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "794": ["Пришли с дыркой.Возврат", "2019-12-10T13:02:24.18949208Z", "синий", "0", 0, 1, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "795": ["Крышки классные - мягкие, хорошо тянутся и держатся после натяжки) Но с описанием тянучести производитель, конечно, переборщил - самая большая крышка  налезла-таки на 5-литровую кастрюлю из мультиварки, но с притык. При этом надо иметь в виду, что на тонкостенную пластиковую посуду надо больший диаметр, иначе крышка сгибает миску). Но в целом, крышки - огонь! очень довольна, буду искать еще пару диметром побольше.", "2019-12-08T20:21:33.784580042Z", "прозрачный", "0", 3, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "797": ["Довольна качеством и упаковкой. Вообще полезная штука. Тем более 6 разных размеров в наборе. Цена и качество огонь, короче", "2019-12-06T15:35:47.691874729Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "799": ["Крышки отличные, а проверить на пункте можно, нужно только вскрыть на кассе сразу, и если брак вернуть. Я так косметику поверяю. Мне пришли все целые. Растягиваются как и заявлено прекрасно. Как раз новогодние разносолы в хрустальных салатниках прикрывать!", "2019-12-03T05:24:52.084288028Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "800": ["Из 6 крышек только 4 оказались целыми, а 2 с дырками причем не маленькими, т.е. они сразу на выброс. Проверить на пункте выдачи их нет возможности, т.к. упаковка заклеена так, что вскрыв ее порвёте фирменную наклейку посредине. Не берите, выброс денег...", "2019-12-02T19:10:59.366998765Z", "прозрачный", "0", 1, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "803": ["Мне понравились", "2019-12-02T11:03:28.489700059Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "805": ["Самая большая крышка закрывает чашу мультиварки, самая маленькая стакан. Мне понравились крышки, прилегают плотно, можно перевернуть и ничего не прольется.", "2019-11-30T16:23:09.859542221Z", "синий", "0", 7, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "806": ["Пока не испробовада,но внешний вид вызывает доверие у товара ,взяла сразу 2 набора", "2019-11-29T22:20:57.81753393Z", "синий", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "807": ["Крышки замечательные! Только одна была с оторванными крылышками, за это 4 звёзды ", "2019-11-29T12:06:29.826944279Z", "прозрачный", "0", 4, 0, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "809": ["Хорошие! Кастрюля без бортиков 4 литра, держится хорошо! Давно приглядывалась) ", "2019-11-29T08:21:00.229334298Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "810": ["Всё отлично. Спасибо", "2019-11-29T04:39:21.35850807Z", "синий", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "811": ["Хорошие крышки, очень удобные, Можно закрывать не только круглые салатники, к прямоугольным и квадратным тоже подходят, прилегают плотно. Пришли без брака.", "2019-11-28T16:29:17.061168287Z", "прозрачный", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "812": ["Хорошие крышки, пришли без повреждений. Уже использовала, всё тянется и прилегает как и хотелось. Рекомендую.", "2019-11-28T07:17:04.373064848Z", "синий", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "816": ["Полезные штуки. Запах конечно присутствует, даже после стирки, но не такой сильный.", "2019-11-24T15:08:54.443736431Z", "прозрачный", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "817": ["Крышки удобные. Самая большая на мультиварочную чашу 5 литров натянулась без труда и повреждений, главное не стараться сильно растянуть, достаточно зацепить за самый первый ободок. Все 6 штук в наличии. Мне понравились.", "2019-11-24T10:15:08.11476838Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "820": ["Очень милые крышечки, полезные", "2019-11-12T13:49:18.066803506Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "821": ["Отличные крышки, незаменимы на кухне любой хозяйки! ", "2019-11-10T16:20:16.197360634Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "826": ["Удобные крышки, можно одевать как на круглую, так и на прямоугольную посуду. Но делать это очень аккуратно, силикон довольно тонкий и быстро рвётся.", "2019-11-07T03:14:21.16604719Z", "прозрачный", "0", 2, 2, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "827": ["Удобные, идеально подошли вместо сломавшихся родных для \"горки\" из 6 металлических мисочек, хорошо тянутся (но до максимального диаметра,  указанного в описании, тянуть не рискнули). Одно \"но\": силикон очень мягкий, страшно что-либо ставить на посудину,  укрытую данной крышкой, особенно, если крышка мало растянута, то есть, диаметр тары равен или чуть больше диаметра крышки.", "2019-11-04T17:13:00.384147944Z", "прозрачный", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "829": ["Незаменимая вещь дома все оценили. Удобно особенно когда остаётся пища закрыть и поставить в холодильник или в шкаф. Запаха не было ни какого. Спасибо. Буду советовать и закажу еще один набор.", "2019-10-31T13:25:24.757961612Z", "прозрачный", "0", 1, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "830": ["Отличные крышки. Рекомендую.", "2019-10-16T04:13:10.87359082Z", "синий", "0", 7, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "833": ["Пришли в комплекте. Посмотрим как в деле себя покажут", "2019-10-06T12:05:50.143321672Z", "прозрачный", "0", 0, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "834": ["крышки понравились, хотя пока не пользовалась", "2019-10-04T13:45:24.511260922Z", "синий", "0", 0, 3, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "835": ["Рекомендую", "2019-10-02T10:51:44.803289441Z", "синий", "0", 0, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "836": ["Товар пришел в двойном полиэтиленовом пакете. Внешний пакет был целым, запечатанным. А вот внутренний, с наклейкой от производителя был порван. И не хватало 1 крышки. В комплекте было заявлено 6 шт. Поэтому возврат. Прошу не учитывать в проценте выкупа.", "2019-09-28T15:59:26.923395643Z", "прозрачный", "0", 1, 3, 4, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "839": ["Комплект очень хороший, подходит на разные формы. Очень одобно в хранении. Советую.", "2019-09-22T13:06:50.995142709Z", "синий", "0", 4, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "841": ["Приобретаю повторно. Комплект очень удобный! Советую.", "2019-09-17T22:16:10.267671768Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "842": ["Ну не знаю, как можно такую крышку с 20 см до 28 растянуть! Покупала для чаши мультиварки с диаметром 23 см, так вот самая большая крышка не натянулась на неё... крышки неплохие, но идут в размер почти не растягиваясь... очень расстроена, покупала из-за мультиварки...", "2019-09-14T12:11:26.240125477Z", "синий", "0", 2, 0, 3, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "843": ["Ужасное качество! Пользовалась пару раз, уже две крышки порвались в хлам, вообще не рекомендую!", "2019-09-09T12:54:18.82122703Z", "синий", "0", 2, 2, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "844": ["одна крышка сразу порвалась. очень тонкие", "2019-08-18T23:59:11.938759868Z", "синий", "0", 2, 0, 1, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "845": ["Гибкие, растягиваются хорошо, тонкие, но прочные. Спасибо", "2019-07-22T09:41:04.394615908Z", "синий", "0", 4, 1, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "847": ["Выкупила набор универсальных растягивающихся крышек, 6 шт,, однако дома увидела, что одна крышка с большой дырой. Рекомендую  распечатывать и смотреть данный товар не отходя от кассы.", "2019-08-11T10:35:23.947495752Z", "синий", "0", 5, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "848": ["На кухне используются постоянно , очень удобное приспособление ", "2019-08-08T16:38:43.210800184Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "849": ["Супер крышки. Силикон, как написано в описании, премиум класса. Рекомендую.)", "2019-08-05T10:55:54.168017022Z", "синий", "0", 4, 2, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"], "850": ["Спасибо за хорошие крышечки, тонкие, хорошо тянутся, плотно закрывают емкости.", "2019-07-29T11:03:02.558645649Z", "синий", "0", 3, 0, 5, "Набор универсальных растягивающихся крышек, 6 шт", "Сибирская посуда"]}
